(80, 31, 21, '15.00', '9.50', '10.00', '9.00', '4.50', '4.00', '3.50', '10.00', '5.00', '5.00', '5.00', '5.00', 'This student has done a remarkable job on this \"invention\" that is really a piece of research/algorithms/code to enable other researchers in this field.\r\nI would suggest that his mentor  UM Chair of\r\nPhysics, Prof. David Gerdes be contacted to get a more knowledgeable evaluation.', '5.00'),
(81, 47, 24, '15.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '5.00', '5.00', '5.00', '4.50', 'I didn\'t see anywhere how these shoes would be charged/ran - solar powered, battery operated, charged? And how long would/should a charge last? \r\nI noticed in your logbook, you added the story about being stuck in traffic in Philadelphia, maybe adding that story to the video pitch could make it more relatable to the viewers who have most likely also been in that similar situation. \r\n', '5.00'),
(82, 51, 24, '15.00', '10.00', '10.00', '10.00', '4.00', '5.00', '5.00', '9.00', '4.50', '5.00', '5.00', '5.00', 'I noticed in the logbook it was stated that there are \"no problems\" and the invention \"works as planned\" could you think of any ways the invention may not work as planned, for example, over time could the wires get tangled and messy in the mesh bag? Or if there are really no problems, how does your product work against those odds? \r\nIs there anything other than a mesh bag you could use that could work better with sustainability? Like a reusable shopping bag or a recycled material bag? Something that could be recycled or safer to dispose of?\r\nYou make this very relatable to adults that use consoles, but is there any way you could make it relatable other than that? Maybe for older adults what could they use this product for? \r\nWould attaching this product to a desk harm the desk? And can it be easily attatched/detached? \r\nI really enjoyed how you compared your products to similar products, but how yours is different and adds the disadvantages of similar products. Adding this to your video pitch could be a good idea!', '5.00'),
