(94, 23, 25, '15.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '9.00', '5.00', '5.00', '5.00', '4.50', 'Comments:\r\n* Great job guys! Your logbook was very detailed and provided me with a lot of information about your whole invention process. I loved getting to see how you tested the cable and how you decided to update your product based on your data collected.\r\n* I marked you guys down on the originality because I have seen other products out there they try to stop this issue of the phone chargers breaking. But I only did 1 point down because I haven\'t seen it to this extent that you guys went by building a cube for the cable to run through.\r\n* I marked you guys down on your online pitch because you had 4 minutes to explain your product to me and only used up 45 seconds. Additionally, only one person spoke in your group, I would have really loved to see each member explain a little bit in your pitch.\r\n\r\nQuestions:\r\n* What new concepts did you develop about charging cables during this invention?\r\n* What was the most difficult part of your invention process?\r\n* What caught you by surprise as you tested each version?', '3.00'),
(95, 23, 63, '14.00', '9.00', '9.00', '8.50', '4.50', '3.50', '4.50', '8.50', '5.00', '3.50', '4.50', '3.50', 'Video presentation is good, explains the idea well. Display board is done well but it was hard to see the contents of the display board in fast paced video. Team worked hard on display board but could not properly show its contents in detail. Idea is creative and some folks will like to try this product. Log book is impressive, well documented and covers it all in a new product development', '3.00'),
