(99, 3, 12, '10.00', '6.00', '8.00', '6.00', '3.00', '3.00', '4.00', '4.00', '1.00', NULL, '5.00', '4.00', '1) All important questions\' answers are missing from Logbook so those are need to ask to these inventors!\r\n2) How this design is going to assemble with main dummy/original hand?\r\n3) Have you discussed this idea/prototype with Physical Therapist or Ortho Specialist to understand Ergonomics inputs?\r\n4) What are limitations with this product? Thanks!														', '4.00'),
(100, 51, 20, '12.50', '7.00', '8.50', '5.00', '4.00', '2.50', '2.50', '6.50', '3.00', '2.50', '4.00', '3.50', '							I really like the name \"Wizen\"!\r\n1-What is maximum capacity of your Wizen bag? \r\n2- Is this a DIY (Do it yourself) kind of solution or you plan to market it?\r\n3- It solves the problem of separating the wires for a particular length, but then what about from outlet of the bag from where wires come out till the Plugin point in the wall?\r\n4- Did you iterate your model?\r\n 														', '5.00'),
(101, 47, 20, '12.50', '8.50', '7.00', '6.00', '3.00', '2.50', '3.00', '7.00', '4.00', '4.00', '4.00', '3.50', '							I really like your numbers and board. 						\r\n1- Many public places do not allow use of Hover board on their premises, why should they allow Electroll Shoes?\r\n2- Who is your target audience age for this?\r\n3- What is the maximum distance electroll shoes can be used before it needs to be charged again?\r\n4- Is the strap permanently attached to the shoe, I am really curious that what if someone needs to climb up the steps then what are their options?\r\n5- What will be the cost of your product for marketing reasons, will it be cheaper then other options on market?\r\n6- How is Electroll shoe more stable and less riskier in your opinion? Would there be any extra safety equipment needed to ride this? \r\n7- How do you control speed, and what will be its speed?\r\n8- Overall curious to know how does it work?\r\n\r\n\r\n\r\n 																					', '5.00'),
(102, 50, 20, '10.00', '5.50', '5.00', '5.50', '3.00', '2.50', '2.50', '5.50', '4.00', '3.00', '2.00', '2.50', '1- What are the limitations of your solutions?\r\n2- What if family does not have treadmill?\r\n3- In question 6 you answered that you want want game to force users to run. What is someone has health problem and cannot run?\r\n4- Relating to point 3, have you researched what is the age limit for using the treadmill? And the risks associated with children using treadmill?\r\n5- If treadmill already tracks your heart rate/ steps etc then why you want to integrate it with your solution?\r\n6- Have you tested your solution?\r\n7- I would like to see your developed demo game as mentioned in answer of Question 10. \r\n8- How many hours did you spend to learn storyboard, x code, python?		\r\n9- You mentioned you surveyed 10 of your friends, why do you think surveying only 10 was enough?												', '4.50'),
(103, 4, 12, '5.00', '5.00', '8.00', '5.00', '2.00', '2.00', '5.00', '2.00', '2.00', '0.00', '3.00', '3.00', '1) All Q/A are missing per standard logbook template? I guess, may be they don\'t have std logbook template!\r\n2) This is duplicate design & available in the market so how you distinguish your product is different than available products?\r\n3) How much mass for this product?\r\n4) Did you discuss with Physical Therapist/Ortho Specialist for ergonomics inputs like short/height personalities etc, ', '3.50'),
(104, 33, 25, '14.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '9.50', '3.00', '5.00', '5.00', '5.00', 'Comments:\r\n\r\nGreat job guys!\r\nIt looks like you started working on your invention process in late January, which means you must have worked very hard up until now with your product.\r\nYour online pitch was very detailed and thorough which I found very helpful. You included a background in products that are already on the market and explained how yours would be different. \r\nI took off points for the identifying and understanding category because I was looking for ways you knew this was a problem other than what was apparent in your own lives. An example might include asking other co-workers from your summer job if they had the same struggles as both of you. But I did appreciate hearing your own experience and why you guys wanted to pursue this product.\r\nMy main concern is with your logbook. You both really explained what your invention process in the video, however, it is not documented enough in the logbook. I would have loved to see data with other people having this problem. Your research that you found regarding this problem/product. I also would have loved to see how you guys tested your product, how you knew it was successful or not. I did, however, really appreciate the photos you included of your invention. It helped me visualize what it looks like and how it would be used.\r\n\r\nQuestions:\r\n* In your video, you mentioned that there were some difficulties when you came to building the product. What were some of those difficulties? How did you make it to your final product?\r\n* In what ways did you test the success of your invention?\r\n* What caught you by surprise when you went through this process.', '5.00'),
(105, 25, 12, '10.00', '8.00', '9.00', '6.00', '3.00', '2.00', '3.00', '5.00', '4.00', '4.00', '5.00', '5.00', '1) Few Q/A are missing from standard Logbook template.\r\n2) How \"crushing leaves functionality\" works with this tool? Per my review, rake functionality works with this tool but I am not convinced with how crushing leaves would be effectively could do with this tool? \r\n', '5.00'),
(106, 21, 25, '14.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '5.00', '4.50', '5.00', '5.00', 'Comments:\r\n\r\n* Your logbook and video were very detailed and organized, I really enjoyed reading it and watching what you all had to say. Nice job! \r\n* I took some points off on the identifying and understanding category because I was looking for ways you investigated that this garbage situation was a problem in urban areas. I see that you listed off the problem areas, but I was really looking for concrete data for how you knew those problems. An example of this could have been going around apartment buildings and asking their opinions of the current trash system in place. \r\n* I also took some points off of your display board because I was looking for a tri-fold board specifically with your information displayed. It appears to be just a big poster board. I appreciate all of the typed information and pictures you provide on your board, which makes understanding your process much easier. \r\n\r\nQuestions:\r\n* What problems did you face during your invention process?\r\n* How did you come up with the price and longevity of the product/\r\n* What did you enjoy most about the invention process?', '5.00'),
(107, 6, 25, '14.00', '5.00', '9.00', '8.00', '5.00', '5.00', '5.00', '9.00', '0.00', '0.00', '5.00', '4.50', 'Comments:\r\n\r\n* Nice work guys! You have a great product that you were able to easily explain so well. I was very impressed.\r\n* As you can see, I had to take a handful of points away for many different reasons. There is no logbook or display board first and foremost. * Additionally, I took off points in the invention process category because I was looking for ways you guys went about your invention process. I was looking for drawings or explanations for your design ideas. I also was looking for how you two modified your product as you went along in the process. I was also looking for ways you knew it this was a problem in your own lives. I really appreciated the resources you cited at the beginning of your video, but I wanted to see concrete data from your own life. For example, asking friends how often they forget to turn off a light or unplug something.\r\n* I took off points for originality because I have seen many products on the market that try to reduce energy usage. But I appreciate the route you guys took it, by going through an app that an individual can manipulate.\r\n* Lastly, for your online pitch I needed to see your faces as you were talking about your product.\r\n* Overall, your invention is very impressive and you both did an excellent job explaining what you created.\r\n\r\nQuestions:\r\n* What problems did you face during the invention process?\r\n* What did you enjoy the most throughout the invention process/\r\n* What was something that took you by surprise while working on your product?', '5.00'),
(108, 42, 38, '14.00', '8.00', '8.00', '5.00', '3.00', '4.00', '5.00', '3.00', '2.50', '3.00', '2.50', '3.50', '							Could you Please explain the prototype in detail?\r\nThe model proposed in the log book is not clear.\r\nI felt log book is not so clear.							', '4.50'),
(109, 40, 25, '14.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '0.00', '5.00', '4.00', '4.50', 'Comments:\r\n\r\n* Nice work! you explained everything very well, you were detailed and thorough in you your online pitch, which helped me out in understanding your thought process.\r\n* I did not get a logbook, so I wasn\'t able to give you any points for that.\r\n* I took some points away for your online pitch because you went over the time limit a little bit.  \r\n* For your prototype, I was hoping for a further explanation of it, and how you knew it worked as a universal piece. \r\n* I took off points in the identifying and understanding category because I was looking for concrete data about how you knew this was a problem. An example might be asking friends that also play guitar to understand if they have the same issue and documenting their responses. \r\n* Overall, you did great at explaining your invention. I really enjoyed learning about the different products already out on the market, and how you would do it a little bit differently.\r\n\r\nQuestions:\r\n* What problems did you face during the invention process?\r\n* What did you enjoy most about the invention process?\r\n* During your research, did you discover anything that surprised you, or that you want to research more? ', '0.00'),
