(204, 144, 223, '13.00', '9.00', '10.00', '9.50', '4.50', '4.50', '4.50', '9.50', '8.50', NULL, '5.00', '14.00', '', NULL),
(205, 151, 223, '11.00', '6.00', '6.00', '6.50', '2.00', '1.00', '1.00', '3.00', '5.50', NULL, '2.00', '10.00', '', NULL),
(206, 148, 224, '14.00', '10.00', '10.00', '8.50', '4.50', '5.00', '4.00', '10.00', '9.50', NULL, '4.50', '11.50', 'Hi guys. I really enjoyed your invention. I liked that you are very persistent to save our struggling planet, and you chose something I have never even thought of before. Most people go for usual oil spill cleanup inventions, or garbage clean up inventions which are already out there. But you\'re growing kelp?! Wow! Very cool and neat idea. I just want to say your pitch did feel a little rushed, and you seemed nervous. Don\'t be nervous- you have a pretty cool invention! Slow down, relax and really grab your audiences attentions. If I can make a suggestion, start your pitch off with a hook. Maybe a question or a scenario to really grab your audience\'s attention! I do have one question, will the kelp still adequately grow if there is an overwhelming amount of garbage in the ocean in that area? I was also curious as to why you chose the Pacific Northwest to place the device. I think it\'s a good idea, because the water there stays about the same temperature year around, but also consider things like tsunamis when plotting where to put the device! Overall, an interesting and cool invention. Good luck!', NULL),
(207, 150, 224, '13.00', '10.00', '10.00', '10.00', '5.00', '4.00', '4.00', '10.00', '10.00', NULL, '4.50', '13.50', 'Hi guys! I really enjoyed listening to your invention idea. I completely agree that music motivates people because when I run at the gym, if I put my music on shuffle and a slow song comes on, I\'m mad because it immediately kills my vibe. I think this is definitely something that could be marketed. I want to also say to start of your pitch by selling the audience. Ask an attention grabbing question or scenario to really capture the audience\'s attention. Overall, nicely done and I can see this being something in the future to have. Good luck!', NULL),
(208, 152, 224, '14.50', '10.00', '10.00', '10.00', '5.00', '5.00', '4.50', '10.00', '10.00', NULL, '5.00', '14.00', 'Hi guys! This was such a cool invention to read about! I think this is very useful and very important to have especially during flu and COVID seasons. It\'s honestly just crucial to have at all times of the year. I think the only questions I have are: How often would it need to be refilled with sanitizing chemicals? And how long would the adhesive last? Other than that, a job well done. Very interesting invention and I hope we have something like this in the future!', NULL),
(209, 168, 224, '14.50', '9.50', '9.50', '9.50', '4.00', '5.00', '5.00', '10.00', '9.50', NULL, '4.50', '13.50', 'Hello! Wow I am absolutely blown away by the amount of work you put into this! A job well done, definitely. I really like this invention a lot because I suffer from motion sickness myself so this definitely hit home for me. I\'ve always had interest in trying out VR, although I could never do it long because I would probably puke from the dizziness. Your invention would help a lot of people just like me! Despite all the positives, I had to give you half credit on your video pitch because it was a bad link. I know that\'s not something you can control, but maybe post it on Youtube using a public account/viewing. It told me I was forbidden to access the video. Either way, I know you submitted one so it would be unfair to give you a 0/15 on it, so I gave you half credit. This is an awesome invention. Good luck! ', NULL),
(210, 169, 224, '12.50', '4.00', '3.50', '7.00', '3.00', '5.00', '3.00', '9.00', '0.00', NULL, '4.50', '12.00', 'Hello! I really liked your idea and thought it was pretty important especially in today\'s time where everyone and anyone is on their phones and computers because we are faced with a global pandemic. I also want to say that your video pitch was the only pitch I\'ve seen that actually made me smile and laugh! I was looking for this aspect in all of the presentations, but yours was the only one that did it for me! I also wanted to say that I liked that you actually hand made a prototype and I could even see it at use! That being said, I did have to score you a 0 on logbook because you do not have one, and also there\'s not much information on different trials and errors during your invention process. I think you should add more details on different trials, add a logbook, and you also need resources to provide support for your invention. Good luck!', NULL),
(211, 150, 231, '15.00', '8.00', '9.00', '8.00', '5.00', '4.50', '5.00', '9.00', '8.00', NULL, '4.00', '12.00', 'Nice job! I would definitely use this product if you were able to expand it to include matching music to strokes per minute for a rowing machine. I don\'t think it would be too difficult to modify as you could still likely use the foot pressure sensor to measure when one pushes off to initiate the stroke.\r\nWhile the logbook is for your team, I would keep in mind that it is not *just* for your team. It would be helpful to have more detailed explanation for how you filled out the decision matrix, for example. You may also want to consider eliminating abbreviations (e.g., idk) and more conversational terms and spellings (e.g., random people, lil).\r\nIf you move on to the next round and have a chance to re-record your pitch, I would recommend 1) not having a ceiling fan in the recording frame and 2) changing the color scheme on the slide with the example of the coding as it was very difficult to read. \r\nIt would also be great to include the coding in the log book, as well as the questions and answers you received from your survey of potential users.', NULL),
(212, 156, 231, '15.00', '5.00', '6.00', '6.00', '3.00', '3.00', '3.00', '8.00', '5.00', NULL, '4.50', '7.50', 'This is a really cool idea, I just wish I knew more about it. You only used about half of your allotted pitch time, so you had the opportunity to explain more of the process of your feeder\'s design and its features. For example, how does the power cord feed through the tiny hole in the bottom of the feeder? Does it detach from the heating pad or is the hole shown not to scale?\r\n\r\nWhile the logbook is for your team, I would keep in mind that it is not *just* for your team. Here is where you could have included potential user survey questions and responses as well as a more detailed narrative about how the project progressed over time. Also, you may want to reread it to consider if everything in there is something you would want a judge to read. You spent a lot of space in your logbook on the marketing of the product, but very little on the product itself. It may be beneficial to shift your efforts to more closely fit the requirements of the project. ', NULL),
(213, 159, 231, '10.00', '7.00', '8.00', '7.00', '4.50', '4.00', '3.00', '8.00', '0.00', NULL, '5.00', '10.00', 'Handy idea! I can definitely see how this would be useful to someone who spends a lot of time in a vehicle. I do wish I understood more about the refinement process for the design. You do a nice job of describing what changes in the design occur, but it is not clear to me why those changes were made. The drawings a helpful, but really tiny in the video viewer so it is hard to make out the details. You had time extra left for your video, so you could have included fewer images per slide in order to make them larger and easier to view. Including a log book would also have made it easier to include more and larger images as well as more details about the project.\r\nSome things I wondered about: Will this fit into different sized cup holders (some are larger than others)? How does the top rubber part accommodate different shaped and sized sauce cups? It looks to be one continuous piece. Also, how does the top fit on to keep spills from happening? How much will this cost to manufacture?', NULL),
(214, 163, 231, '15.00', '10.00', '10.00', '10.00', '4.50', '4.50', '5.00', '10.00', '8.50', NULL, '4.00', '14.00', 'Such a very cool idea!\r\nIf you are to move to the next round of competition and have the opportunity to re-record your pitch, I\'d consider 1) having the slides take up more of the screen so the information on the slides is a bit larger and easier to see and 2) either not sit in a chair that swivels or be mindful of not swiveling during the presentation.\r\n\r\nI wondered about the cost of moving a home in the more traditional way. You may have had that on one of the slides but I couldn\'t clearly read it and I don\'t recall you talking about it. Also, do you have a sense of how much this system you\'ve designed will cost? Can the system be used separately from the shipping container home if someone liked the idea but wanted a home constructed from wood, let\'s say, or must they be used together? Did you do any potential user surveys? It would be great to include the questions and responses in your log book.\r\nKeep up the good work!', NULL),
(215, 169, 231, '11.00', '4.00', '7.00', '6.50', '3.00', '2.50', '2.00', '4.00', '7.00', NULL, '4.00', '11.00', 'I completely understand the need for this product, but I wish I knew more about it. Many aspects of the required information are missing. You had a lot of time left for the video, so there was the opportunity to include more information. The log book was also missing, which was another avenue for reporting on the process of the project.\r\nIt feels like an updated version of the old \"blue blocker\" glasses. It would be great to know how these are different. How much would they cost? Did you do any potential user surveys (beyond the guy in the video)? If so, what were the questions and the responses?', NULL),
(216, 145, 225, '14.00', '9.00', '8.00', '7.00', '4.50', '5.00', '4.50', '9.00', '7.00', NULL, '5.00', '13.00', '', NULL),
