(220, 143, 222, '13.00', '6.00', '9.00', '6.00', '5.00', '4.00', '4.50', '8.50', '0.00', NULL, '3.50', '9.00', 'Great Project! The Idea is very Interesting and has a lot of potential. \r\nQ: How did you come to this Idea? how was your journey during your designing process. was this your first Idea?  \r\nyour presentation was very well done! I think it would have been more informative if you had some visuals to aid your explanations.  \r\n\r\n', NULL),
(221, 145, 226, '12.50', '8.50', '10.00', '8.00', '5.00', '5.00', '5.00', '8.00', '7.00', NULL, '5.00', '14.00', 'I think this is a great invention! My only question is lets say somebody wants to use to clean a bigger space, would they buy multiple devices or would it not be as effective? Also how can we trust that it is effectively cleaning the air? Great job!!!', NULL),
(222, 150, 226, '15.00', '10.00', '10.00', '9.00', '5.00', '5.00', '5.00', '8.00', '8.50', NULL, '5.00', '15.00', 'I think this idea is super awesome:) One question  I have is what do you expect the life expectancy to be for this device? How long will it last before you need to get a new one?', NULL),
(223, 154, 226, '14.00', '10.00', '10.00', '8.50', '5.00', '5.00', '3.00', '9.00', '9.00', NULL, '5.00', '13.50', 'Super cool idea! A question I have is would this have any negative effects on our environment or the water system? And another thing I was wondering is how much would this all cost to build ?', NULL),
(224, 158, 226, '11.00', '7.50', '6.00', '5.00', '3.50', '3.00', '3.50', '7.50', '7.50', NULL, '4.50', '11.00', 'Hey good job! How do you know that this would solve the problem for overheating computers? Do you think there should be a solution that is put inside the computer itself rather than on the outside? ', NULL),
(225, 164, 226, '15.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '10.00', NULL, '5.00', '15.00', 'Hey Cali! I really enjoyed your pitch and think you idea is super cool:) I know you mentioned that this would have to be used probably in warmer climates but how much of the population that needs clean water and electricity, lives in climates that are cooler or drier and could we somehow use this invention to help them too?', NULL),
(226, 162, 222, '13.50', '10.00', '10.00', '9.00', '4.00', '4.00', '4.00', '10.00', '10.00', NULL, '3.50', '14.00', 'This Idea is Very Interesting and very helpful especially right now during this pandemic.', NULL),
(227, 184, 222, '15.00', '8.50', '9.00', '9.00', '4.00', '4.50', '5.00', '9.00', '9.00', NULL, '5.00', '14.00', '', NULL),
(228, 162, 220, '14.50', '5.00', '9.00', '8.00', '3.50', '2.50', '4.50', '9.00', '7.00', NULL, '4.00', '13.50', 'Good evaluation of sources, but should also have considered cell  phone sanitization products that do not involve washing, or similar products like Google Glass.  An opportunity exists to improve on the negative response of Google Glass .  Clever alternative to the cell phone screen.  A HUD projector may allow the shield to be replaced with minimal expense.\r\nPresentation material was well understood but speech could have use more practice.  Room to improve presentation by not having to move video image.', NULL),
(229, 168, 220, '12.00', '9.00', '8.00', '5.00', '4.00', '3.50', '4.00', '9.00', '8.00', NULL, '3.50', '13.50', 'Only one source plus personal story for problem statement.  It would have been better to have some interface.  If the original coding source was not available there are many sources to design the top level application without the backend.  Value proposition and market value were not clearly identified.\r\nVideo pitch was not available.', NULL),
(230, 153, 228, '15.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '10.00', NULL, '5.00', '14.50', 'This invention was a really good idea! I know a lot of friends and family who would definitely use one of your masks to prevent their glasses from fogging up! I like how you mentioned that this product could also help ensure people are wearing their masks correctly because their glasses fogging up would no longer pose an issue! ', NULL),
(231, 157, 228, '15.00', '8.00', '7.00', '7.00', '2.00', '1.00', '1.00', '5.00', '0.00', NULL, '1.00', '8.00', 'This was a good idea for people who constantly need to be charging their iPhones! I liked how you thought of a way to make a portable charger that doesn\'t need to charge and won\'t die soon after you start using it! One thing to improve on in the future is your logbook, the only thing that was included under your logbook link was a single picture of your invention! I would have loved to look at your diagrams, research, and overall process while watching your video and learning about your product! ', NULL),
(232, 162, 228, '15.00', '10.00', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '10.00', NULL, '5.00', '15.00', 'Your product was such a unique and useful idea! Phones are so gross and collect so many germs, it would be really useful and practical to invest in your invention! Your research, video, and logbook were all very interesting and I enjoyed imagining the benefits of using your product on my trips to the grocery store! ', NULL),
(233, 163, 228, '13.00', '9.00', '10.00', '10.00', '5.00', '2.50', '2.50', '10.00', '10.00', NULL, '5.00', '14.50', 'Your invention was so complex and unique! This idea had never crossed my mind, but I bet this would be especially helpful in areas that are susceptible to hurricanes! I would have like to seen more about the market viability as well as the environmental and societal effects! Great invention and engineering in designing this product!', NULL),
(234, 172, 228, '15.00', '7.50', '10.00', '10.00', '5.00', '5.00', '5.00', '10.00', '10.00', NULL, '5.00', '15.00', 'This would definitely be a product that I would buy! I feel like my fresh produce always goes bad, so it was really neat seeing your research in creating a container that helps you keep your fruit fresh and eat/enjoy it at the best time! I love the detail and research that went into designing this invention! ', NULL),
(235, 164, 17, '13.00', '8.00', '8.00', '8.00', '3.00', '3.00', '3.00', '7.00', '9.00', NULL, '4.00', '14.00', 'Interesting idea and good presentation! The power generated from this approach might not enough for powering the 110 V AC home appliances - try to think about how to increase the output voltage and power. You may also use the vibration of rain falling to generate electricity using a piezoelectric element.\r\n\r\n', NULL),
(236, 166, 17, '13.00', '5.00', '7.50', '6.00', '3.00', '3.00', '3.00', '5.00', '8.00', NULL, '4.00', '12.50', 'Opening and closing windows automatically based on outside and inside temperature is a nice idea! You need to think critically does this approach solves the AC cooling and pollution problem, because opening the window might not be enough to cool the room on a hot summer day. You may think of a fan that will blow air over ice or something like that.', NULL),
(237, 173, 17, '14.00', '9.00', '8.50', '7.00', '4.50', '4.00', '4.50', '7.00', '8.00', NULL, '4.00', '13.00', 'Nice idea and well done! Next job is to program an Arduino, interface the sensor and the warning light.  ', NULL),
(238, 184, 17, '10.00', '6.00', '7.50', '6.00', '3.00', '3.00', '3.00', '5.00', '8.00', NULL, '4.00', '12.00', 'Well done. You need to check with different cameras and verify whether your design is an easy-to-use universal solution.  ', NULL),
(239, 185, 17, '13.00', '7.50', '6.00', '5.50', '4.00', '3.50', '4.00', '7.50', '5.50', NULL, '2.50', '5.00', 'Interesting idea! Write using clear and short sentences. During oral presentation, make sure the sound is clear and you are showing enthusiasm. ', NULL),
(240, 158, 223, '11.00', '6.00', '7.00', '6.00', '2.50', '1.50', '3.00', '7.50', '8.50', NULL, '4.50', '10.50', 'The video doesn\'t mention anything about the fan, and I don\'t see it on the final product, was that idea scrapped?', NULL),
(241, 172, 223, '13.50', '10.00', '9.50', '8.50', '5.00', '5.00', '4.00', '10.00', '8.50', NULL, '3.50', '14.50', '', NULL),
