(243, 168, 222, '9.00', '7.00', '8.50', '8.50', '3.50', '4.00', '4.00', '8.00', '8.00', NULL, '3.50', '13.00', '', NULL),
(244, 146, 233, '14.00', '9.00', '9.00', '8.00', '5.00', '5.00', '5.00', '9.00', '10.00', NULL, '5.00', '13.00', 'Could you go into more details about the capabilities of the UV light, filters and other mechanical air movement devices?  This might convince me that your product scientifically works.', NULL),
(245, 159, 233, '12.00', '9.00', '7.00', '7.00', '5.00', '4.00', '4.00', '9.00', '0.00', NULL, '4.00', '12.00', 'Is this device encouraging distracted driving by encouraging eating behind the wheel, or does it reduce distracted driving by making sauce locations fixed and more stable?\r\nCould you have done more testing before the final prototype was made to show your invention in use? Explain what you would do?', NULL),
(246, 167, 233, '14.00', '10.00', '10.00', '9.00', '5.00', '4.00', '4.00', '9.00', '10.00', NULL, '5.00', '14.00', 'Would using aluminum instead of plastic really make the product more recyclable?  Can a metal box vs. a plastic box do more scratching and nick-damage to boats made of coated fiberglass?  Great pitch video.  Excelled prototype.  Could you have done more testing and refining? (i.e., put an adhesive closed cell foam on the bottom of the container to make it float better and do less scratching?', NULL),
(247, 174, 233, '13.00', '9.00', '8.00', '8.00', '3.00', '4.00', '4.00', '9.00', '10.00', NULL, '4.00', '13.00', 'he social impact was well described on the sanitation side.  But what is the cost to maintain the complexity of the system?  \r\nYou clearly described the design of the product.  But you did not give any cost to build information and possible selling price - what is the premium over a toiletus regularis? (Latin/Greek?)', NULL),
(248, 186, 233, '13.00', '8.00', '5.00', '8.00', '3.00', '4.00', '4.00', '8.00', '9.00', NULL, '3.00', '13.00', 'After reviewing the logbook I can see the magnitude of the USB C cable problems.  Why did I not see any examples for guitars? This made my understanding the  presentation a bit vague.\r\nCan you describe why there were four suction cups?', NULL),
