(85, 'Tanay Panja', 'Machine learning for smart delivery is an access control system using machine learning and image recognition. This can create a more secure environment for groceries and supplies, as it will identify the face to see who it is and allow access to them to their food. It runs on solar power, and shipments can be combined to conserve fossil fuels, making it an ideal system.\r\nThe Delivery robot will have wheels and drawers for different items. I developed a program in Python 3 that uses a machine-learning algorithm to automate better access control for the delivery robot so that the robot can unlock the right container, based on image recognition. This type of robot can combine deliveries and prevent customers from driving hundreds of miles for items to help avoid emitting greenhouse gases from fossil fuels of cars. Providing better access control can prevent theft and misplacement of items so that the right items can be delivered to the right owner in the same route. Better access control can help reduce transportation for grocery and other items among many persons. We can combine the shipments of multiple customers using delivery carpools.\r\nThe access control based on image recognition will open the lock for the right drawer so the right food is delivered to the right person and donâ€™t have to travel by road to get the food from the cafeteria/or shops. Also, the delivery robot combines food delivery by room numbers in the same building. The car built by me is a prototype of a delivery robot, and Iâ€™ve used a VNC Viewer to control the movement of the car remotely using a laptop, iPad, or phone. It currently uses the internet to connect to the remote control of the car. VNC is a remote control software that allows you to view and interact with a Raspberry Pi using a simple program (the \"viewer\") on another computer/mobile device anywhere on the Internet.\r\n', NULL, NULL, NULL, NULL, '6-8', '2021', 1),
