(184, 'Search and Rescue Drone Universal Attachment System (SDUAS)', 'Our goal is to create a system that will allow for interchangeability between different payloads and equipment that could be used by a small drone on a Search and Rescue (SAR) mission. These pieces of equipment could include an optical camera, an infrared camera, a radio direction finder, or any other piece of equipment that a SAR agency would use with a small drone. ', '../test_upload/Universal SAR Drone Attachment System Logbook.pdf', NULL, 'https://youtu.be/_VJSsXQych0  ', NULL, '9-12', '2021', 0),
(185, '3D Printing Filament Recycling System', 'Our Project is a 3D printing filament recycling system, designed to reduce waste created by 3D printing\r\nand decrease the immense amount of excess plastic created in each print because 3D printing is becoming\r\nmore and more commonplace, its important to mitigate the amount of plastic created by 3D printing or\r\nelse the amount of pollution it causes will increase dramatically as it becomes more and more\r\ncommonplace. Our design is a heated chamber with a nozzle at the bottom and a lid at the top that will be\r\nfilled with dehydrated support materials and failed prints, melting them all down, at which point a cap\r\nplaced over the nozzle will be removed, allowing the now combined and melted plastic to flow smoothly\r\nout in a thin line of filament that can be used for future projects, after the filament is long enough it can be\r\nattached to a spool on a motor to allow for easier storage in a more conventional manner, decreasing\r\nplastic waste even further by reusing old spools used to hold filament.', '../test_upload/Logbook AE AMC IC project.pdf', NULL, 'https://www.youtube.com/watch?v=oucBEXvH6iw', NULL, '9-12', '2021', 0),
(186, 'The Cable Connector', 'In order to solve the problem of loose cables which can result in issues that range from major to minor issues, I decided to create a system of adjustable suction cups in order to create a product that keeps cables safe and secure.', '../test_upload/The cable connector Logbook.pdf', NULL, 'https://youtu.be/va7W13yQezU', NULL, '9-12', '2021', 0),
